# s = "cbaebabacd"
# p = "abc"
# s = "abab"
# p = "ab"
# s ='fhabefhijhlmifh'
# p = 'ihf'
s = ""
p = ""
sorted_p = sorted(p)
sorted_str_p = ''.join(sorted_p)

answer = []

for i in range(len(s) - len(p) + 1):
    word = list(s[i: i + len(p)])
    word.sort()
    sorted_word = ''.join(word)

    if sorted_str_p == sorted_word:
        answer.append(i)


print(answer)
